import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2025 Saint Francis Reunion. All rights reserved.</p>
      <div className="footer-contact">
        <a href="tel:+639493540311">Call Us</a> |{' '}
        <a href="mailto:meg2dud@yahoo.com">Contact Us</a>
      </div>
    </footer>
  );
};

export default Footer;
